int from_base64(string num) {
    int base = 64;
    int res = 0;
    for (int i = 0; i < num.size(); ++i) {
        res *= base;
        int digit = num[i];
        if(digit >= 63) digit--;
        if(digit >= 92) digit--;
        res += digit - 48;
    }
    return res;
}

int main() {
    stringstream ss(prefix_sums_brute);
    string num;
    while (ss >> num) {
        prefix_sums.push_back(from_base64(num));
    }
    int t;
    cin >> t;
    while (t--) {
        int l, r; cin >> l >> r;
        cout << (prefix_sums[r] - prefix_sums[l - 1] + MOD) % MOD << '\n';
    }
    return 0;
}